import React from 'react'
import ExpenseItems from "./components/ExpenseItems";


function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <ExpenseItems
        title={expenses[0]}
        amount={expenses[0]}
        date={expenses[0]}
      ></ExpenseItems>
      <ExpenseItems
        title={expenses[1]}
        amount={expenses[1]}
        date={expenses[1]}
      ></ExpenseItems>
      <ExpenseItems
        title={expenses[2]}
        amount={expenses[2]}
        date={expenses[2]}
      ></ExpenseItems>
      <ExpenseItems
        title={expenses[3]}
        amount={expenses[3]}
        date={expenses[3]}
      ></ExpenseItems>
    </div>
  );
}

export default App;
